Actionscript.script:
function 攻击时移动(慢速度, 快速度)
{
   if(_parent.方向 == "右")
   {
      _parent.移动("右",慢速度);
   }
   else if(_parent.方向 == "左")
   {
      _parent.移动("左",慢速度);
   }
}
gotoAndPlay(_parent.近战招式);

function 射击(){
	var itemData = _root.getItemData(_parent.手枪).data;
	var 子弹属性 = _root.子弹属性初始化(this.攻击点);

	子弹属性.声音 = itemData.sound;
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = itemData.diffusion;
	子弹属性.发射效果 = itemData.muzzle;
	子弹属性.子弹种类 = "穿刺子弹";
	子弹属性.子弹威力 = _parent.手枪威力表[_parent.手枪];
	子弹属性.子弹速度 = 40;
	子弹属性.Z轴攻击范围 = 25;
	子弹属性.击倒率 = 7;

	子弹属性.斩杀 = 5;

	_root.子弹区域shoot传递(子弹属性);
}

var 兵种 = "敌人-汽车炸弹";

var 僵尸型敌人newname = _parent._name + 兵种 + _parent.汽车炸弹数量;
_root.加载游戏世界人物(兵种,僵尸型敌人newname,_root.gameworld.getNextHighestDepth(),{
	_x: _parent._x, 
	_y: _parent.Z轴坐标, 
	方向: _parent.方向,
	等级: _parent.等级, 
	名字: "汽车炸弹", 
	是否为敌人: _parent.是否为敌人, 
	身高: 175,
	产生源: _parent._name,
	登场动画: "变形"
});

_parent.汽车炸弹数量--;

onClipEvent(load){
   if(_root.是否阴影 == true)
   {
      this._visible = 1;
   }
   else
   {
      this._visible = 0;
   }
}
